ement("p",null,"II. Pyramid selling"),u.default.createElement("p",null,"III. Unauthorized use of a computer"),u.default.createElement("p",null,"IV. Mischief in relation to data"),u.default.createElement("p",null,"V. Fraud"),u.default.createElement("p",null,"VI. Obscenity"),u.default.createElement("p",null,"VII. Child pornography"),u.default.createElement("p",null,"21.2 Civil Offences and Violations of the Rights of Others"),u.default.createElement("p",null,"While using the Services and Products, you are prohibited from posting, uploading, reproducing, distributing or otherwise transmitting information or materials where such activity gives rise to civil liability or from otherwise violating the rights or assisting others to violate the rights of KOSMOS MOBILE or any third party, including, but not limited to, the violations below:"),u.default.createElement("p",null,"I. Copyright infringement"),u.default.createElement("p",null,"II. Trademark infringement"),u.default.createElement("p",null,"III. Defamation"),u.default.createElement("p",null,"21.3 Other"),u.default.createElement("p",null,"While using the Services and Products, you are prohibited from engaging in or assisting others to engage in any activity that (1) violates established or accepted network etiquette, (2) violates applicable charters, FAQS, policies, rules or guidelines of KOSMOS MOBILE or other parties, (3) disrupts or threatens the integrity, operation or security of any Services and Products or any computer or Internet system, (4) elicits complaints from other Internet users, (5) is contrary to any law or regulation, or (6) in the sole judgment of KOSMOS MOBILE, is otherwise objectionable, (6) involves use of KOSMOS MOBILE's trade-marks, trade names or logos, including without limitation any such trade-marks, logos or service marks displayed on any web site(s) operated by KOSMOS MOBILE, without KOSMOS MOBILE's express prior written permission; (7) involves sharing, reselling, reproducing, copying, distributing, redistributing, or exploiting for any commercial purposes, any portion of, use of or access to, the KOSMOS MOBILE Internet Services, except where expressly authorized by KOSMOS MOBILE. Examples of such prohibited activity include, but are not limited to:"),u.default.createElement("p",null,'I. Posting, uploading, reproducing, distributing or otherwise transmitting unauthorized or unsolicited commercial e-mail, junk or bulk e-mail, chain letters, or other "spam"'),u.default.createElement("p",null,"II. Engaging in threats, harassment, intimidation, stalking or abuse of others"),u.default.createElement("p",null,"III. Scanning another computer system"),u.default.createElement("p",null,"IV. Probing another computer system"),u.default.createElement("p",null,"V. Obstructing or bypassing computer identification procedures"),u.default.createElement("p",null,"VI. Engaging in unauthorized computer or network trespass"),u.default.createElement("p",null,"VII. Exporting equipment, software, or data outside of Canada or the U.S. in contravention of applicable export control legislation"),u.default.createElement("p",null,"Each Customer must use reasonable care in keeping software they run on KOSMOS MOBILE's servers up-to-date and patched with the latest security updates. Failure to use reasonable care to protect your account may result in a security compromise by outside sources. A compromised server creating network interference will result in immediate Customer notification and will be disconnected from the network immediately so as to not directly affect other Customers. No service credits will be issued for outages resulting from disconnection due to breached server security. The Customer is solely responsible for any breaches of security under Customer control affecting servers. If a Customer intentionally creates a security breach, the cost to resolve any damage to Customer's server or other servers will be charged directly to the Customer. The labor used to resolve such damage is categorized as Emergency Security Breach Recovery and is currently charged at $300 CAD per hour."),u.default.createElement("p",null,"21.4. System and Network Security"),u.default.createElement("p",null,"Violations of system or network security are strictly prohibited, and may result in criminal and civil liability. KOSMOS MOBILE investigates all incidents involving such violations and will cooperate with law enforcement if criminal violation is suspected."),u.default.createElement("p",null,"Examples of system or network security violations include, without limitation, the following:"),u.default.createElement("p",null,"I. Introduction of malicious programs into the network or server (example: viruses, worms, Trojan Horses and other executables intended to inflict harm)."),u.default.createElement("p",null,'II. Effecting security breaches or disruptions of Internet communication and/or connectivity. Security breaches include, but are not limited to, accessing data of which the Customer is not an intended recipient or logging into a server or account that the Customer is not expressly authorized to access. For purposes of this section, "disruption" includes, but is not limited to port scans, flood pings, email-bombing, packet spoofing, IP spoofing and forged routing information.'),u.default.createElement("p",null,"III. Executing any form of network activity that will intercept data not intended for the Customer's server."),u.default.createElement("p",null,"IV. Circumventing user authentication or security of any host, network or account."),u.default.createElement("p",null,"V. Interfering with or denying service to any user other than the Customer's host (example: denial of service attack or distributed denial of service attack)."),u.default.createElement("p",null,"VI. Using any program script/command, or sending messages of any kind, designed to interfere with or to disable, a user's terminal session, via any means, locally or via the Internet."),u.default.createElement("p",null,"VII. Failing to comply with the Company's procedure relating to the activities of Customers on the Company's premises. Violators of the policy are responsible, without limitations, for the cost of labor to correct all damage done to the operation of the network and business operations supported by the network. Such labor is categorized as Emergency Security Breach Recovery and is currently charged at $300 CAD per hour required. Network interference by any Customers that may cause or is currently causing network interference with another Customer will be disconnected immediately. No service credits will be issued to Customers disconnected for network violations."),u.default.createElement("p",null,"VIII.Transmission, distribution or storage of any material in violation of any applicable law or regulation is prohibited. This includes, without limitation, material protected by copyright, trademark, trade secret or other intellectual property right used without proper authorization, and material that is obscene, defamatory, constitutes an illegal threat, or violates export control laws."),u.default.createElement("p",null,'IX. Sending Unsolicited Bulk Email ("UBE", "spam"). The sending of any form of Unsolicited Bulk Email through KOSMOS MOBILE\'s servers is prohibited. Likewise, the sending of UBE from another service provider advertizing a web site, email address or utilizing any resource hosted on KOSMOS MOBILE servers is prohibited. KOSMOS MOBILE accounts or services may not be used to solicit customers from, or collect replies to, messages sent from another Internet Service Provider where those messages violate either this Policy or that of the other provider.'),u.default.createElement("p",null,'X. Running Unconfirmed Mailing Lists. Subscribing email addresses to any mailing list without the express and verifiable permission of the email address owner is prohibited. All mailing lists run by KOSMOS MOBILE customers must be Closed-loop ("Confirmed Opt-in"). The subscription confirmation message received from each address owner must be kept on file for the duration of the existence of the mailing list. Purchasing lists of email addresses from 3rd parties for mailing to from any KOSMOS MOBILE.-hosted domain, or referencing any KOSMOS MOBILE account, is prohibited.'),u.default.createElement("p",null,"XI. Advertising, transmitting, or otherwise making available any software, program, product, or service that is designed to violate this AUP or the AUP of any other Internet Service Provider, which includes, but is not limited to, the facilitation of the means to send Unsolicited Bulk Email, initiation of pinging, flooding, mail-bombing, denial of service attacks."),u.default.createElement("p",null,"XII. Operating an account on behalf of, or in connection with, or reselling any service to, persons or firms listed in the Spamhaus Register of Known Spam Operations (ROKSO) database at www.spamhaus.org."),u.default.createElement("p",null,'XIII. Unauthorized attempts by a user to gain access to any account or computer resource not belonging to that user (e.g., "cracking").'),u.default.createElement("p",null,"XIV. Obtaining or attempting to obtain service by any means or device with intent to avoid payment."),u.default.createElement("p",null,"XV. Accessing or attempting to access your account or other KOSMOS MOBILE services after you (or Company) has cancelled Customer's account."),u.default.createElement("p",null,"XVI. Unauthorized access, alteration, destruction, or any attempt thereof, of any information of any KOSMOS MOBILE customers or end-users by any means or device, including the use of 'sudo' or other privileged operating system commands."),u.default.createElement("p",null,"XVII. Knowingly engage in any activities designed to harass, or that will cause a denial-of-service (e.g., synchronized number sequence attacks) to any other user whether on the KOSMOS MOBILE network or on another provider's network."),u.default.createElement("p",null,"XVIII. Using KOSMOS MOBILE Services to interfere with the use of the KOSMOS MOBILE network by other customers or authorized users."),u.default.createElement("a",{
href:"#top"},"Back to top of page"),u.default.createElement("p",null),u.default.createElement("p",null,"22. BROADCAST TERMS OF SERVICE"),u.default.createElement("p",null,"22.1.  Broadcast TOS Applicability"),u.default.createElement("p",null,"Any use of the KOSMOS Mobile Software in a Program for Broadcast shall be subject to its Broadcast TOS. If you want to use the KOSMOS Mobile Software in a Program (as defined below) for Broadcast (as defined below), you must agree to KOSMOS Mobile's Broadcast TOS. If you do not agree to the Broadcast TOS and supply the required Registration Information, you may not use the KOSMOS Mobile Software in a Program for Broadcast."),u.default.createElement("p",null,"22.2.  Registration"),u.default.createElement("p",null,'Before your first use of the KOSMOS Mobile Software in a Program for Broadcast, you must supply the information specified in KOSMOS Mobile\'s standard Broadcast TOS registration form (the "Registration Form") available by contacting support@KOSMOSmobile.com '),u.default.createElement("p",null,"22.3.  Definitions"),u.default.createElement("p",null,'I. "Broadcast" means to transmit simultaneously to the general public through any now known and unknown media and formats, including, without limitation, a data communications network, the Internet, electronic mail system, television, radio or satellite system, point to multipoint transmission over a wired, wireless or fiber network; and for purposes of these Broadcast TOS shall also include narrowcasting and multicasting.'),u.default.createElement("p",null,'II.  "Program" means a live or pre-recorded audio or visual performance.'),u.default.createElement("a",{href:"#top"},"Back to top of page"),u.default.createElement("p",null),u.default.createElement("p",null,"23. PRIVACY POLICY  CANADA"),u.default.createElement("p",null,'When you install the KOSMOS App and register on the Site, you will be asked to provide us with your phone number and to allow us access to your mobile device\'s address book (collectively, "Personal Information"). A copy of the phone numbers and names in your address book (but not emails, notes or any other personal information in your address book) will be stored on our servers and will only be used to:'),u.default.createElement("p",null,"a. notify you when your contacts become active on KOSMOS,"),u.default.createElement("p",null,"b. indicate which of your contacts is already a KOSMOS user,"),u.default.createElement("p",null,"c. correctly display the name of each contact as it appears in your address book when a call is received."),u.default.createElement("p",null,"In addition, we may also create a function in the future that will use this data to synchronize your address book across your multiple devices."),u.default.createElement("p",null,'The copy of your address book (names and phones) is stored on a live database. This database does not have a "historical backup". If you delete the address book from our servers (more about this below), it will be deleted instantly and permanently.'),u.default.createElement("p",null,"Your phone number, which will be verified via a text message that will be sent to you, will be used for identification purposes as your KOSMOS user ID."),u.default.createElement("p",null,"KOSMOS also maintains a Call Detail Record (CDR - see http://en.wikipedia.org/wiki/Call_detail_record) for each call conducted on the system. These are industry standard records used by all phone companies. We maintain this information in order to better understand network behavior and trends (numbers of calls made by users, typical destinations, call lengths, network type, etc.), detect potential outages and technical issues (this helps us notice things like a drop in call volume in a certain geography, a shift in call length, a change in typical networks, etc.) and for public safety reasons. All log analysis is done in an anonymous, aggregate, non-personally identifiable manner. We may look into a specific Call Detail Record in response to a customer support request. We maintain CDRs for a period of no more than 30 months."),u.default.createElement("p",null,"Audio calls by users are transmitted either directly from user to user or, if direct transmission is not possible (due to, for example, firewalls), KOSMOS servers are used to transmit the call. In the latter scenario, the information transmitted is stored briefly in volatile memory (RAM) solely to enable the transmission of the call to the other user. WE DO NOT RECORD ANY PART OF YOUR CALL."),u.default.createElement("p",null,'23.1 KOSMOS Mobile Inc. ("KOSMOS Mobile") is strongly committed to respecting and protecting your privacy. Please carefully read the following Privacy Policy. In order to ensure your privacy, personal information KOSMOS Mobile collects from its customers, as well as visitors to its website located at www.KOSMOSMobile.com ("Site"), is used only in the manner and for the purposes described in this Privacy Policy. "Personal information" includes information about an identifiable individual, presented in any form, such as: age, name, ID number(s), income, ethnic origin, opinions, evaluations, social status, disciplinary actions, credit records, loan records, medical records, but does not include the name, title, business address and telephone number of an employee of an organization. KOSMOS Mobile\'s Privacy Policy is enacted pursuant to the Personal Information Protection and Electronic Documents Act (Canada), and applies to the collection of personal information from Canadian customers by KOSMOS Mobile. US and other non-Canadian customers are subject to the KOSMOS Mobile US Privacy Policy. This'),u.default.createElement("p",null,"Privacy Policy is organized along ten privacy principles, which are:"),u.default.createElement("p",null,"I. Accountability"),u.default.createElement("p",null,"II.  Identifying Purposes"),u.default.createElement("p",null,"III. Consent"),u.default.createElement("p",null,"IV.  Limiting Collection"),u.default.createElement("p",null,"V. Limiting Use, Disclosure and Retention"),u.default.createElement("p",null,"VI.  Accuracy"),u.default.createElement("p",null,"VII. Safeguards"),u.default.createElement("p",null,"VIII.  Openness"),u.default.createElement("p",null,"IX.  Individual Access"),u.default.createElement("p",null,"X. Challenging Compliance"),u.default.createElement("p",null,"PRINCIPLE #1  ACCOUNTABILITY"),u.default.createElement("p",null,"KOSMOS Mobile is responsible for personal information under its control and will designate an individual or individuals who are accountable for the organization's compliance with the following principles."),u.default.createElement("p",null,"I. Accountability for KOSMOS Mobile's compliance with the principles rests with the senior management of KOSMOS Mobile and the person or persons designated by senior management as Privacy Officer, even though other individuals within the organization may be responsible for the day-to-day collection and processing of personal information. In addition, other individuals within the organization may be delegated to act on behalf of senior management or the Privacy Officer."),u.default.createElement("p",null,"II. KOSMOS Mobile's Privacy Officer may be contacted at:"),u.default.createElement("p",null,"Attention: KOSMOS Mobile Inc. c/o Privacy Officer "),u.default.createElement("p",null,"123 St, Singapore"),u.default.createElement("p",null,"E-mail: privacyofficer@KOSMOSMobile.com "),u.default.createElement("p",null,"Phone: 1-604-787-1209"),u.default.createElement("p",null),u.default.createElement("p",null,"I. KOSMOS Mobile is responsible for personal information in its possession or custody, including information that has been transferred to a third party for processing. KOSMOS Mobile will use contractual or other means to provide a comparable level of protection while the information is being processed by a third party."),u.default.createElement("p",null,"II. KOSMOS Mobile will implement policies and practices to give effect to these principles, including:"),u.default.createElement("p",null,"a. implementing procedures to protect personal information;"),u.default.createElement("p",null,"b. establishing procedures to receive and respond to complaints and inquiries;"),u.default.createElement("p",null,"c. training staff and communicating to staff information about KOSMOS Mobile's policies and practices; and"),u.default.createElement("p",null,"d. developing information to explain KOSMOS Mobile's policies and procedures."),u.default.createElement("p",null,"PRINCIPLE #2  IDENTIFYING PURPOSES"),u.default.createElement("p",null,"KOSMOS Mobile will identify the purposes for which personal information is collected at or before the time the information is collected."),u.default.createElement("p",null,'I. KOSMOS Mobile collects personal information only for the following purposes ("identified purposes"):'),u.default.createElement("p",null,"II. to provide service(s) and/or products to its customers;"),u.default.createElement("p",null,"III. to maintain commercial relations and to communicate with its customers (which will include, but not be limited to: billing, collection, advertising, promotion, account verification);"),u.default.createElement("p",null,"a. to identify customer needs and/or preferences;"),u.default.createElement("p",null,"b. to meet legal and regulatory requirements;"),u.default.createElement("p",null,"c. to administer and manage its business operations; and"),u.default.createElement("p",null,"d. as otherwise required or permitted by law"),u.default.createElement("p",null,"IV. Mobile will provide notice of the identified purposes either orally, electronically or in writing prior to or at the time of collection of the personal information."),u.default.createElement("p",null,"V. If individual persons collect personal information, they will be able to specify the purposes for which the information is being collected, or will refer the individual whose information is being collected to a designated person at KOSMOS Mobile who will specify the purposes."),u.default.createElement("p",null,"VI. When personal information that previously has been collected is to be used for a purpose not previously identified, the new purpose will be identified prior to use. Unless the new purpose is required by law, and subject to the exceptions referred to in Principle #3, KOSMOS Mobile will obtain the consent of the individual before information is used for that new purpose."),u.default.createElement("p",null,"VII. Occasionally, KOSMOS Mobile will communicate to you special bonus and new product offers that we think may be of value to you. KOSMOS Mobile may retain third parties to assist it in marketing such new or additional KOSMOS Mobile products and services to our customers (and for such purpose may share personal information with such third parties) but will not otherwise disclose or make available any personal information to any third parties seeking to market their products to KOSMOS Mobile's customers. All KOSMOS Mobile customers have the right to choose not to participate in direct marketing of new products and services from KOSMOS Mobile. If you wish to opt-out of receiving targeted communications from KOSMOS Mobile in electronic, printed or verbal format (other than information included with your monthly bills), simply inform us in writing at:"),u.default.createElement("p",null,"Attention: KOSMOS Mobile Inc. c/o Privacy Officer "),u.default.createElement("p",null,"123 St, Singapore"),u.default.createElement("p",null,"E-mail: privacyofficer@KOSMOSMobile.com"),u.default.createElement("p",null,"VIII. The Site may provide hyperlinks, which are highlighted words or pictures within a hypertext document that may, when clicked, take you to another place within the document, to another document altogether, or to a third party website not controlled by KOSMOS Mobile. Such hyperlinked third party websites may collect and disclose information different than this Site. KOSMOS Mobile is not responsible for the collection, use, or disclosure of information collected through these third party web sites, and KOSMOS Mobile expressly disclaims any and all liability related to such collection, use, or disclosure."),u.default.createElement("p",null,"PRINCIPLE #3  CONSENT"),u.default.createElement("p",null,"The knowledge and consent of the individual are required for the collection, use or disclosure of personal information, except where inappropriate."),u.default.createElement("p",null,"I. In certain circumstances, personal information can be collected, used, or disclosed without the knowledge and consent of the individual. For example, where collection or use is clearly in the interests of the individual and consent cannot be obtained in a timely way; where used or disclosed in the case of an emergency that threatens the life, health or security of an individual; where personal information is publicly available as defined by regulation; where collection with knowledge or consent might compromise the availability or accuracy of the information and the collection relates to investigation of a breach of agreement or contravention of law; or to comply with a subpoena, warrant or court order."),u.default.createElement("p",null,"II. Where required, KOSMOS Mobile will generally seek consent for the use or disclosure of the information at the time of collection. In certain circumstances, consent with respect to use or disclosure may be sought after the information has been collected but before use (for example, when KOSMOS Mobile wants to use information for a purpose not previously identified)."),u.default.createElement("p",null,"III. KOSMOS Mobile will make a reasonable effort to ensure that the individual is advised of the purposes for which the information will be used. To make the consent meaningful, the purposes will be stated in such a manner that the individual can reasonably understand how the information will be used or disclosed."),u.default.createElement("p",null,"IV. KOSMOS Mobile will not, as a condition of the supply of a product or service, require an individual to consent to the collection, use, or disclosure of information beyond that required to fulfill the explicitly specified and legitimate purposes."),u.default.createElement("p",null,"V. The form of consent sought by KOSMOS Mobile may vary, depending upon the circumstances and the type of information disclosed. KOSMOS Mobile will seek express consent when the information is likely to be considered sensitive. Implied consent will generally be appropriate when the information is less sensitive."),u.default.createElement("p",null,"VI. An individual may withdraw consent at any time, subject to legal or contractual restrictions and reasonable notice. KOSMOS Mobile will inform the individual of the implications of such withdrawal. In order to withdraw consent, an individual must provide notice to KOSMOS Mobile in writing."),u.default.createElement("p",null,"VII. With respect to personal information already collected by KOSMOS Mobile prior to the publication of this Privacy Policy, this Policy will constitute reasonable notice to KOSMOS Mobile's current customers of the purposes and uses for which such personal information has been collected. Should an individual object to these ongoing uses or disclosures, consent may be withdrawn upon providing notice to KOSMOS Mobile in writing."),u.default.createElement("p",null,"PRINCIPLE #4  LIMITING COLLECTION"),u.default.createElement("p",null,"The collection of personal information will be limited to that which is necessary for the purposes identified by KOSMOS Mobile. Information will be collected by fair and lawful means."),u.default.createElement("p",null,"I. KOSMOS Mobile collects personal information from its customers for the purposes described under Principle #2."),u.default.createElement("p",null,"II. KOSMOS Mobile may also collect personal information from such third parties as credit bureaus, employers or personal references or other third parties that represent that they have the right to disclose the information."),u.default.createElement("p",null,"III. The Site uses a feature of Internet web browsers called a cookie, which is a file that is sent to your browser from the Site's computers and stored on your computer's hard drive. A cookie assigns a unique identification code to your computer in order to collect anonymous information. On this Site, cookies are used to help us track visitors, conduct research and improve our content and services."),u.default.createElement("p",null,"IV. KOSMOS Mobile's cookies do not collect personal information. KOSMOS Mobile only collects personal information if you knowingly and willingly provide such information."),u.default.createElement("p",null,"V. You may set your Internet web browser to notify you when you receive a cookie or to prevent cookies from being sent. If you prevent a cookie from being sent, you may limit the functionality of the Site."),u.default.createElement("p",null,"PRINCIPLE #5  LIMITING USE, DISCLOSURE, AND RETENTION"),u.default.createElement("p",null,"Personal information will not be used or disclosed for purposes other than those for which it was collected, except with the consent of the individual or as otherwise required or permitted by law. Personal information will be retained only as long as necessary for the fulfillment of those purposes or as otherwise required or permitted by law."),u.default.createElement("p",null,"I. KOSMOS Mobile may collect, use or disclose personal information without the individual's knowledge or consent in certain circumstances as described in Principle #3.1."),u.default.createElement("p",null,"II. KOSMOS Mobile may disclose a customer's personal information to:"),u.default.createElement("p",null,"a. a person involved in the development, promotion, marketing or enhancement of KOSMOS Mobile services;"),u.default.createElement("p",null,"b. emergency services in an emergency situation;"),u.default.createElement("p",null,"c. a person, who, in the reasonable estimation of KOSMOS Mobile, is an agent of the customer;"),u.default.createElement("p",null,"d. third party affiliates for administrative purposes (for example, customer billing, marketing, etc.); and"),u.default.createElement("p",null,"a. any other third party, upon receiving the consent of the customer or as required by law."),u.default.createElement("p",null,"III. Such disclosures may in some cases be to recipients outside of Canada."),u.default.createElement("p",null,"IV. Personal information may also be disclosed in connection with a sale, transfer or reorganization of one or more of KOSMOS Mobile's businesses, in which case KOSMOS Mobile will require that any personal information will continue to be treated in accordance with this Privacy Policy or as otherwise permitted by law."),u.default.createElement("p",null,"V. KOSMOS Mobile will retain personal information that has been used to make a decision about an individual long enough to allow the individual access to the information after the decision has been made, and, in the event of an access request or a challenge, long enough to exhaust any recourse an individual may have under the law."),u.default.createElement("p",null,"PRINCIPLE #6  ACCURACY"),u.default.createElement("p",null,"Personal information will be updated as necessary for the purposes for which it is to be collected and used."),u.default.createElement("p",null,"I. The extent to which personal information will be updated will depend upon the use of the information, taking into account the interests of the individual. Information will be sufficiently accurate, complete, and up-to-date to minimize the possibility that inappropriate information may be used to make a decision about the individual."),u.default.createElement("p",null,"II. KOSMOS Mobile will not routinely update personal information unless such a process is necessary to fulfill the purposes for which the information was collected."),u.default.createElement("p",null,"III. Personal information that is used on an ongoing basis, including information that is disclosed to third parties, will generally be accurate and up-to-date to the best of KOSMOS Mobile's knowledge, unless limits to the requirement for accuracy are clearly set out."),u.default.createElement("p",null,"PRINCIPLE #7  SAFEGUARDS"),u.default.createElement("p",null,"KOSMOS Mobile will use reasonable efforts to protect personal information by security safeguards appropriate to the sensitivity of the information."),u.default.createElement("p",null,"I. KOSMOS Mobile has invested and deployed a wide variety of technology and security features to ensure the privacy of personal and anonymous information on its network. In addition, KOSMOS Mobile has implemented strict operations guidelines to safeguard customer privacy at every level of its organization. KOSMOS Mobile will continue to revise policies and implement additional security features as new technologies become available. Unfortunately, no system is perfect; therefore, KOSMOS Mobile makes no representations or warranties with regard to the sufficiency of these security measures. KOSMOS Mobile shall not be responsible for any actual or consequential damages (or any other damages or liability of any kind whatsoever, whether as a result of negligence or otherwise) that result from a lapse in compliance with this Policy because of a security breach or technical malfunction."),u.default.createElement("p",null,"II. KOSMOS Mobile protects all personal information regardless of the format in which it is held. The methods of protection include:"),u.default.createElement("p",null,"a. physical measures, such as locked filing cabinets and restricted access to offices;"),u.default.createElement("p",null,'b. organizational measures, such as security clearances and limiting access on a "need to know" basis;'),u.default.createElement("p",null,"c. technological measures, such as the use of passwords and encryption."),u.default.createElement("p",null,"III. KOSMOS Mobile makes their employees aware of the importance of maintaining the confidentiality of personal information. KOSMOS Mobile employees are governed by non-disclosure obligations. These obligations prohibit disclosure or use of any confidential or personal information except in accordance with this Privacy Policy."),u.default.createElement("p",null,"PRINCIPLE #8  OPENNESS"),u.default.createElement("p",null,"KOSMOS Mobile will, upon written request, make readily available to individuals specific information about its policies and practices relating to the management of personal information, other than confidential commercial information."),u.default.createElement("p",null,"I. KOSMOS Mobile will make its policies and practices with respect to the management of personal information comprehensible and accessible, by providing upon request:"),u.default.createElement("p",null,"a. the name, title, and address of the Privacy Officer accountable for KOSMOS Mobile's policies and practices and to whom complaints or inquiries can be forwarded;"),u.default.createElement("p",null,"b. the means by which an individual can gain access to his or her personal information held by KOSMOS Mobile; and"),u.default.createElement("p",null,"c. a description of the type of information held by KOSMOS Mobile and/or its subsidiaries, including a general account of its use."),u.default.createElement("p",null,"II. KOSMOS Mobile will make this Privacy Policy available online at its website."),u.default.createElement("p",null,"PRINCIPLE #9  INDIVIDUAL ACCESS"),u.default.createElement("p",null,"Upon written request, an individual will be informed of the existence, use, and disclosure of his or her personal information and will be given access to that information. An individual will be able to challenge the accuracy and completeness of the information and have it amended as appropriate."),u.default.createElement("p",null,"I. Upon written request, KOSMOS Mobile will inform an individual whether or not the organization holds personal information about that individual, and will provide that individual with a reasonable opportunity to review the personal information in his or her file."),u.default.createElement("p",null,"II. KOSMOS Mobile will allow the individual access to his or her personal information once the individual has provided KOSMOS Mobile with a written request application. The application will include sufficient information to permit KOSMOS Mobile to provide an account of the existence, use, and disclosure to any third parties of this personal information. KOSMOS Mobile will use the application only for this purpose."),u.default.createElement("p",null,"III. KOSMOS Mobile will respond to an individual's written request within 30 days, unless this period is extended in accordance with applicable legislation, in which case notice will be sent to the individual within 30 days regarding the extension, the reasons for it and the individual's rights in connection with it. KOSMOS Mobile will assist any individual who informs it that they need assistance in preparing a request. While the response will typically be provided at no cost to the individual, depending on the nature of the request and the amount of information involved, KOSMOS Mobile reserves the right to impose a cost. In these circumstances, KOSMOS Mobile will inform the individual of the approximate cost to provide the response and proceed upon payment. The requested information will be provided or made available in a form that is generally understandable."),u.default.createElement("p",null,"IV. KOSMOS Mobile will be as specific as possible in providing an account of third parties to which it has disclosed personal information about an individual. When it is not possible to provide a list of the organizations to which it has actually disclosed information about an individual, KOSMOS Mobile will provide a list of organizations to which it may have disclosed information about the individual."),u.default.createElement("p",null,"V. In certain instances, KOSMOS Mobile will not be able to provide the individual access to his or her personal information. Where permitted, the reasons for denying access will be provided to the individual. This will be done upon the individual's request, unless KOSMOS Mobile is required by law to provide such written reasons. Exceptions to the grant of an access request may include: information that contains references to other individuals or contains confidential commercial information, where such information cannot be severed from the record; information protected by solicitor-client privilege; information properly collected without the knowledge or consent of the individual for purposes related to investigating a breach of an agreement or a contravention of law; information generated in the course of a formal dispute resolution process; and as required or permitted by law."),u.default.createElement("p",null,"VI. When an individual successfully demonstrates the inaccuracy or incompleteness of personal information, KOSMOS Mobile will amend the information as required. Depending upon the nature of the information challenged, amendment may involve the correction, deletion or addition of information. Where appropriate, the amended information will be transmitted to third parties having access to the information in question."),u.default.createElement("p",null,"VII. When a challenge is not resolved to the satisfaction of the individual, KOSMOS Mobile will record the substance of the unresolved challenge. When appropriate in KOSMOS Mobile's judgment, the unresolved challenge will be transmitted to third parties having access to the information in question."),u.default.createElement("p",null,"PRINCIPLE #10  CHALLENGING COMPLIANCE"),u.default.createElement("p",null,"An individual will be able to address a challenge concerning compliance with the above principles to KOSMOS Mobile's Privacy Officer."),u.default.createElement("p",null,"I. KOSMOS Mobile will maintain procedures to receive and respond to complaints or inquiries about its policies and practices relating to the handling of personal information."),u.default.createElement("p",null,"II. KOSMOS Mobile will inform individuals who make inquiries or lodge complaints of the existence of relevant complaint procedures."),u.default.createElement("p",null,"III. The person or persons accountable for compliance with this Privacy Policy may seek external advice where appropriate before providing a final response to individual complaints."),u.default.createElement("p",null,"VI.  KOSMOS Mobile will investigate all complaints. If a complaint is found to be justified, KOSMOS Mobile will take appropriate measures, including, if necessary, amending its policies and practices."),u.default.createElement("p",null,"Effective Date"),u.default.createElement("p",null,"This Privacy Policy may be modified from time to time without notice. This policy was last updated on June 28, 2016."),u.default.createElement("a",{href:"#top"},"Back to top of page"),u.default.createElement("p",null),u.default.createElement("p",null,"24. PRIVACY POLICY  UNITED STATES OF AMERICA"),u.default.createElement("p",null,'When you install the KOSMOS App and register on the Site, you will be asked to provide us with your phone number and to allow us access to your mobile device\'s address book (collectively, "Personal Information"). A copy of the phone numbers and names in your address book (but not emails, notes or any other personal information in your address book) will be stored on our servers and will only be used to:'),u.default.createElement("p",null,"a. notify you when your contacts become active on KOSMOS,"),u.default.createElement("p",null,"b. indicate which of your contacts is already a KOSMOS user,"),u.default.createElement("p",null,"c. correctly display the name of each contact as it appears in your address book when a call is received."),u.default.createElement("p",null,"In addition, we may also create a function in the future that will use this data to synchronize your address book across your multiple devices."),u.default.createElement("p",null,'The copy of your address book (names and phones) is stored on a live database. This database does not have a "historical backup". If you delete the address book from our servers (more about this below), it will be deleted instantly and permanently.'),u.default.createElement("p",null,"Your phone number, which will be verified via a text message that will be sent to you, will be used for identification purposes as your KOSMOS user ID."),u.default.createElement("p",null,"KOSMOS also maintains a Call Detail Record (CDR - see http://en.wikipedia.org/wiki/Call_detail_record) for each call conducted on the system. These are industry standard records used by all phone companies. We maintain this information in order to better understand network behavior and trends (numbers of calls made by users, typical destinations, call lengths, network type, etc.), detect potential outages and technical issues (this helps us notice things like a drop in call volume in a certain geography, a shift in call length, a change in typical networks, etc.) and for public safety reasons. All log analysis is done in an anonymous, aggregate, non-personally identifiable manner. We may look into a specific Call Detail Record in response to a customer support request. We maintain CDRs for a period of no more than 30 months."),u.default.createElement("p",null,"Audio calls by users are transmitted either directly from user to user or, if direct transmission is not possible (due to, for example, firewalls), KOSMOS servers are used to transmit the call. In the latter scenario, the information transmitted is stored briefly in volatile memory (RAM) solely to enable the transmission of the call to the other user. WE DO NOT RECORD ANY PART OF YOUR CALL."),u.default.createElement("p",null,'KOSMOS Mobile VoIP Inc. and its affiliated entities ("KOSMOS Mobile") are committed to your privacy. We obey all laws and regulations in the United States applicable to our use and disclosure of your information. Except as set forth in this Privacy Policy, we will not trade, sell, or disclose to any third party any form of PII (as defined below) without your consent and we will not disclose or make available any PII to any third parties seeking to market third party products without your consent. We have set forth this Privacy Policy to explain to you how we collect and use information from our customers who use services and products from KOSMOS Mobile ("Customers") and from visitors to our Web sites and from potential customers who have communicated, made contact, or interacted with KOSMOS Mobile ("Visitors"), both in connection with online and offline services and products offered by KOSMOS Mobile.'),u.default.createElement("p",null,"24.1. Collection of Information"),u.default.createElement("p",null,'KOSMOS Mobile shall collect personally identifiable information, including but not limited to name, physical address, email address, telephone number, credit card information, and other personal information (collectively, "PII"), from Customers when initiating service and in connection with the provision or marketing of products and services. KOSMOS Mobile may collect PII from Visitors in connection with any visit to our Web sites, any communication about our services and products, or other transactions or interactions with KOSMOS Mobile.'),u.default.createElement("p",null,'KOSMOS Mobile may also collect non-personally identifiable information from Customers and Visitors regarding usage of our services or our Web site ("Non-PII"). Non-PII may include Web site pages viewed, time spent using certain services, demographic data, cookies, and other information which does not specifically identify any one individual.'),u.default.createElement("p",null,'"Cookies" are pieces of information that may be placed on your computer by a Web site for the purpose of facilitating and enhancing your communication and interaction with that Web site. Many Web sites use cookies for these purposes. We may use cookies to customize your visit to our Web sites and for other purposes to make your visit '),u.default.createElement("p",null,"In addition to our cookies, we and our vendors and contractors may also use clear gifs, Web beacons, and third party cookies to improve the performance of our Web sites, provide certain features such as advertising, or to anonymously track usage of our Web sites and the online activity of users. In addition, we may use such devices in our HTML-based emails to track the usage of such emails in much the same manner as usage of our Web sites is tracked."),u.default.createElement("p",null,"You may stop or restrict the placement of cookies on your computer, including third party cookies, or flush them from your browser by adjusting your Web browser preferences, in which case you may still use our Web site, but it may interfere with some of its functionality."),u.default.createElement("p",null,"24.2. Anti-Spyware Policy"),u.default.createElement("p",null,"KOSMOS Mobile believes that Spyware is a threat to consumer privacy and a consumer's experience online. Therefore, we forbid any KOSMOS Mobile employee, agent, partner, affiliate, or contractor from intentionally deploying or using Spyware (as defined in this policy) on behalf of KOSMOS Mobile. Spyware refers to any executable software application that is installed on a user's personal computer and covertly gathers and transmits PII through the user's Internet connection without the knowledge or consent of the user. Cookies and Web beacons are not considered Spyware. Spyware may gather PII, such as e-mail addresses and credit card information, and may even alter personal computer settings. Intentional use of Spyware by any KOSMOS Mobile employee, agent, partner, or affiliate on KOSMOS Mobile's behalf will not be tolerated and will be considered grounds for dismissal, contract termination, and/or loss of payment."),u.default.createElement("p",null,"24.3. Use of Information"),u.default.createElement("p",null,"KOSMOS Mobile will use PII to (1) market products and services to Customers and Visitors that KOSMOS Mobile believes may be of interest to them, (2) provide services and products requested by Customers and Visitors and (3) enable its vendors, contractors and partners to provide and assist KOSMOS Mobile in the marketing and provision of such services and products to KOSMOS Mobile, Customers, or Visitors or to participate in joint marketing offers with KOSMOS Mobile. In our contracts with vendors, contractors and partners, we require them to protect PII and to limit their use of such information to the purposes for which it is provided. They may not use this information for their own independent marketing purposes. If you purchase products and services offered jointly by KOSMOS Mobile and one of our partners, PII may be received and shared by both KOSMOS Mobile and our partner. Each company's privacy policy may apply. However, we will not share your credit card information with any third parties unless they are involved in processing payments for services that you have purchased from KOSMOS Mobile. KOSMOS Mobile only works with partners whom we believe maintain high standards with respect to privacy and consumer rights."),u.default.createElement("p",null,"KOSMOS Mobile may also use and disclose PII to investigate and help prevent potentially unlawful activity or activities that threaten the integrity of our service or network, to investigate fraud or violations of our EndUserLicenseAgreement, as required by courts or administrative agencies or in connection with a sale, merger, or reorganization of KOSMOS Mobile's business."),u.default.createElement("p",null,"24.4. CPNI"),u.default.createElement("p",null,'In the course of providing services to you, we collect and maintain certain customer proprietary network information ("CPNI"). CPNI includes the types of services you currently purchase, related usage and billing information for those services. Your telephone number, name, and address are not CPNI. We value our relationships with our customers and are committed to respecting and protecting your CPNI. Accordingly, we do not sell, trade, or share your CPNI, including your calling records outside of KOSMOS Mobile or with anyone not authorized to offer our products or services, or to perform functions on our behalf except as authorized by you or required by law. Generally, we can use your CPNI to offer additional services to you, and for billing and collections purposes. We can also disclose your CPNI for legal or regulatory reasons, including in response to subpoenas and court orders, without your prior knowledge or consent. We can also use CPNI to investigate fraud and to prevent violation of our Terms of Service and unlawful use of our network, services, and other customers.'),u.default.createElement("p",null,"24.5. Security"),u.default.createElement("p",null,"KOSMOS Mobile has invested and deployed a wide variety of technology and security features to make reasonable efforts to ensure the privacy of information on its network. In addition, KOSMOS Mobile has implemented operations guidelines to ensure Customer and Visitor privacy is safeguarded throughout its organization. KOSMOS Mobile will continue to revise policies and implement additional security features as new technologies becomes available. However, no system or service can give a 100% guaranty of security, especially a service that relies upon the public Internet. Therefore, you acknowledge the risk that third parties may gain unauthorized access to your information when using or accessing our services and our network."),u.default.createElement("p",null,"24.6. Communications"),u.default.createElement("p",null,"KOSMOS Mobile will not read, listen to or disclose to any third parties private e-mail, conversations, or other communications that are transmitted using KOSMOS Mobile services except as required to ensure proper operation of services or as otherwise authorized by law, or with your prior consent."),u.default.createElement("p",null,"You should be aware that any PII which you voluntarily include and transmit through publicly accessible forums (i.e., such as chat rooms, blogs, instant messages, listservs) may be viewed and used by anyone with access to such forums. KOSMOS Mobile is unable to control such uses of your PII, and by using such services, you assume the risk that the PII provided by you may be viewed and used by third parties."),u.default.createElement("p",null,"24.7. Account Information"),u.default.createElement("p",null,"Subject to certain security requirements, KOSMOS Mobile will do its best to honor requests from Customers for their own account information, including name, address, company, or billing information. The Customer is responsible for ensuring that the information on file with KOSMOS Mobile is current and accurate."),u.default.createElement("p",null,"24.8. Children's Privacy Policy"),u.default.createElement("p",null,"KOSMOS Mobile does not sell products or services for purchase by children. KOSMOS Mobile does not knowingly solicit or collect PII from children or teenagers under the age of thirteen (13). If you believe that a minor has disclosed PII to KOSMOS Mobile, report this to us at privacyofficer@KOSMOSmobile.com."),u.default.createElement("p",null,"24.9. KOSMOS Mobile Spam Policy"),u.default.createElement("p",null,"KOSMOS Mobile has zero tolerance for spam. Spam complaints will be dealt with seriously and can result in losing KOSMOS Mobile privileges such as loss of referral credits and even loss of a customer's account. If you receive spam and want to report it to KOSMOS Mobile, please forward the email you have received to spam@KOSMOS Mobile.com"),u.default.createElement("p",null,"24.10. Third Party Web Sites and Services"),u.default.createElement("p",null,"Our service may contain links to other Web sites and services not maintained by KOSMOS Mobile. In addition, other Web sites and services may also reference or link to KOSMOS Mobile. We encourage you to be aware when you leave our service, or surf the Internet, and to read the privacy statements of each and every Web site and service that you visit. We do not endorse, screen, or approve, and are not responsible for the privacy practices or the content of, such other Web sites and services."),u.default.createElement("p",null,"KOSMOS Mobile does not assume, and expressly disclaims, any liability for third parties that have been provided with information as permitted by this Privacy Policy or who have collected information as permitted by this Privacy Policy (such as advertisers using third party cookies)."),u.default.createElement("p",null,"24.11. Opt-out Policy"),u.default.createElement("p",null,"If you do not want your PII used by KOSMOS Mobile for any direct marketing purposes, then you may opt-out of such disclosures by emailing us at optout@KOSMOSmobile.com."),u.default.createElement("p",null,"However, we are not responsible for removing your PII from the lists of any third party who has previously been provided your information in accordance with this policy. Since KOSMOS Mobile must use a Customer's PII in order to provide them with KOSMOS Mobile services, Customers cannot opt-out of all uses of their PII unless they cancel their service."),u.default.createElement("p",null,"24.12. Changes to Policy"),u.default.createElement("p",null,"We reserve the right, at our discretion, to change, modify, add, or remove portions from this policy at any time by posting such changes here. You should review this policy regularly for changes, and can easily see if changes have been made by checking the Effective Date below. However, if at any time in the future we plan to use PII in a way that differs from this policy, we will post such changes here and provide you the opportunity to opt-out of such differing uses. Your continued use following the posting of any changes to this policy means you accept such changes."),u.default.createElement("p",null,"24.13. Terms of Service"),u.default.createElement("p",null,"For Customers, this Privacy Policy is subject to the KOSMOS Mobile Terms of Service or other agreements between you and KOSMOS Mobile. If you are a Customer, please refer to the Terms of Service or such other agreements regarding certain rights and limitations with respect to your use of KOSMOS Mobile's services."),u.default.createElement("p",null,"24.14. United States of America"),u.default.createElement("p",null,"Our service is maintained in the United States of America. By using our services, you authorize the export of PII to the USA and its storage and use by KOSMOS Mobile or its vendors, contractors and partners, anywhere in the world, as specified in this policy."),u.default.createElement("p",null,"24.15. Questions"),u.default.createElement("p",null,"For common questions and answers regarding our privacy policy or to contact us, go to Privacy Policy: FAQs."),u.default.createElement("p",null,"24.16. Effective Date"),u.default.createElement("p",null,"This Privacy Policy was last updated on November-29-11."),u.default.createElement("a",{
href:"#top"},"Back to top of page"),u.default.createElement("p",null),u.default.createElement("p",null,"25. SECURITY POLICY"),u.default.createElement("p",null,"This privacy policy explains how KOSMOS Mobile treats personally identifiable information that KOSMOS Mobile collects and receives. Personally identifiable information is information about our customers that can identify them, such as name, address, e-mail address or phone number."),u.default.createElement("p",null,'This policy also applies to our use of what our industry calls "Customer Proprietary Network Information" (CPNI). CPNI relates to the use of KOSMOS Mobile voice services. It includes the length of calls; the phone numbers that customers call and similar information. CPNI does not include personally identifiable information such as name, telephone number and e-mail address.'),u.default.createElement("p",null,"This policy does not apply to the practices of companies that KOSMOS Mobile does not own or control, or to people KOSMOS Mobile does not employ or manage. However, when KOSMOS Mobile uses companies, agents, contractors or other third parties to perform services on its behalf, KOSMOS Mobile requires that they protect CPNI and personally identifiable information consistent with this policy."),u.default.createElement("p",null,"25.1.  Accessing Private Information"),u.default.createElement("p",null,"A central feature of KOSMOS Mobile's product is its ability to integrate a user's telephony and e-mail systems into a unified service. In order to accomplish this, KOSMOS Mobile's software may access contact lists maintained by third-party products such as Microsoft Outlook. We do not use this information for any purpose other than to enable these features. We will never contact anyone in your address book, nor allow anyone inside or outside of KOSMOS Mobile to have access to this information."),u.default.createElement("p",null,"Other information we collect may be used to protect customers, employees and property against fraud, theft or abuse, to conduct surveys and to maintain good customer relations."),u.default.createElement("p",null,"25.2.  Information We Collect"),u.default.createElement("p",null,"KOSMOS Mobile collects personally identifiable information and CPNI when customers register with KOSMOS Mobile, when customers use KOSMOS Mobile products or services, when customers visit KOSMOS Mobile Web pages or the Web pages of certain KOSMOS Mobile partners and when customers choose to enter promotions or sweepstakes or participate in a survey."),u.default.createElement("p",null,"When a customer registers for a KOSMOS Mobile account, we require name, gender, address, contact number, e-mail address and a password."),u.default.createElement("p",null,"Customers may also provide information in response to surveys conducted by KOSMOS Mobile either online or offline. If this information is connected directly to your personally identifiable information, it is personally identifiable information under this policy. In addition, customers may provide KOSMOS Mobile with personal information when they interact with us. For example, customers may provide such information when requesting or using KOSMOS Mobile customer service."),u.default.createElement("p",null,"25.3.  Use of Information"),u.default.createElement("p",null,"25.3.1.  Administrative Messages"),u.default.createElement("p",null,"KOSMOS Mobile uses personally identifiable information to create and maintain accounts, including the delivery of important administrative messages such as service announcements, privacy policy updates, terms of service updates, rate plan changes, balance notifications and account status notifications regarding that particular account (by e-mail, text message, call from customer service or any combination). Please note that when you do not opt in to marketing offers described herein, we will continue to send you this important account-related information."),u.default.createElement("p",null,"25.3.2.  Information Sharing and Disclosure"),u.default.createElement("p",null,"I. We may share information with companies that work on behalf of KOSMOS Mobile to provide a product or service that has been requested. We share this information only when it is required to deliver the service in question, and any company working with KOSMOS Mobile to deliver such a service does not have a right to use the information we provide to them beyond what is necessary to assist us in delivering that product or service."),u.default.createElement("p",null,"II.  You may elect to participate in KOSMOS Mobile-sponsored contests, giveaways, sweepstakes or other promotions and product or service opportunities that KOSMOS Mobile may sponsor. If KOSMOS Mobile should use third parties to deliver these promotions, KOSMOS Mobile will share only the information required to allow them to do their job and will not allow the third party to use information for any other purposes without appropriate permission."),u.default.createElement("p",null,"III. We respond to subpoenas, court orders, or legal process, or to establish or exercise legal rights or defend against legal claims."),u.default.createElement("p",null,"IV.  We share information when we believe it is necessary to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of KOSMOS Mobile terms of use or as otherwise required or permitted by law or consistent with legal requirements."),u.default.createElement("p",null,"V. We will transfer information about our customers if KOSMOS Mobile is acquired by or merged with another company."),u.default.createElement("p",null,"25.3.3.  Ability to Update or Delete Information"),u.default.createElement("p",null,"KOSMOS Mobile gives you the ability to update and delete personal information you have provided to us. Please note that any information that we have obtained may remain in backup storage for some period of time after a deletion request. This may be the case even though we will not use such information. Further, we retain call and other records consistent with legal requirements."),u.default.createElement("p",null,"25.4.  PERSONALIZATION, COOKIES, WEB BEACONS AND AGGREGATE DATA"),u.default.createElement("p",null,"This section identifies how KOSMOS Mobile and third parties use Web technologies such as cookies and Web beacons, and identifies how your IP address may be seen or used as you use the KOSMOS Mobile service. These technologies are generally used to improve or personalize a service in some way so that it is easier to use. Cookies are small text files placed on a computer's hard drive by a Web site when a customer visits that site. Cookies are used within the KOSMOS Mobile service as follows:"),u.default.createElement("p",null,"25.4.1.  Cookies identify a customer's computer and record customer preferences and other data about the visit. When customers return to the site, the site knows who they are and can personalize the visit to that site. KOSMOS Mobile uses cookies to collect information to improve and personalize our services and make suggestions to customers. In most cases your computer will provide you with the ability to clear cookies and to disable cookies (this depends on the browser you are using)."),u.default.createElement("p",null,"25.4.2.  When you log in to the web site or use your phone, KOSMOS Mobile recognizes your identity. Independently of cookies, KOSMOS Mobile may personalize your experience and suggestions on the web site or on your phone."),u.default.createElement("p",null,"25.4.3.  KOSMOS Mobile may also place Web beacons on its site in conjunction with cookies to monitor how visitors are navigating and/or interacting with the site. A Web beacon is a small, sometimes transparent graphic image on a Web page, Web-based document or in an e-mail message that is designed to allow the site owner or a third party to monitor the address and other information of the user visiting the Web site or sending or responding to the e-mail. Web beacons are used within the KOSMOS Mobile service as follows:"),u.default.createElement("p",null,"I. When the Web beacon points to a site to retrieve the image, at the same time it can pass along information such as the IP address of the computer, the time the Web beacon was viewed and for how long and the type of browser that retrieved the image."),u.default.createElement("p",null,"II.  KOSMOS Mobile uses Web beacons to improve its site design and operational and business practices over time."),u.default.createElement("p",null,"III. In some, but not all, computers and phones, turning off the browser's cookies will prevent Web beacons from tracking the user's activity. The Web beacon will still account for an anonymous visit, but the information unique to the user will not be recorded."),u.default.createElement("p",null,"25.5.  IP ADDRESSES"),u.default.createElement("p",null,"IP addresses are used in the KOSMOS Mobile service as follows:"),u.default.createElement("p",null,"I. An IP address allows information to be sent to and from a computer (or a phone or other device) on the Internet. IP addresses are often temporarily assigned. Temporarily assigned addresses are assigned to a user for a period of time so the user typically does not have the same address each time they use the service. If a user is using a permanent IP address (more common with servers than mobile, dial-up, DSL or cable Internet users), they will have the same address each time they use the service. KOSMOS Mobile collects IP addresses when people access our Web site."),u.default.createElement("p",null,"II.  KOSMOS Mobile phones receive temporary IP addresses when they use data services. These addresses are reassigned after each data session. IP addresses from KOSMOS Mobile phones are hidden from third parties you visit. These third parties cannot collect KOSMOS Mobile IP addresses."),u.default.createElement("p",null,"25.6.  CUSTOMER PROPRIETARY NETWORK INFORMATION "),u.default.createElement("p",null,"Customers have a right, and KOSMOS Mobile has a duty, under the law to ensure the confidentiality of CPNI. KOSMOS Mobile may use customer CPNI to market additional communications and data products and services similar to the types currently purchased from us. Again subject to your permission, KOSMOS Mobile may contact you to market additional products and services we and our partners sell."),u.default.createElement("p",null,'KOSMOS Mobile also discloses customer CPNI as required by law (see "Information Sharing and Disclosure" above). And, to provide service, we may use and disclose CPNI to our agents and independent contractors, but we restrict their use and limit disclosure of CPNI for purposes of providing service or to market products and services as previously described. We will also prohibit the third party from further disclosing the CPNI except as required by law and will require the third party to implement safeguards to protect the confidentiality of the CPNI.'),u.default.createElement("p",null,"25.7.  CONFIDENTIALITY AND SECURITY"),u.default.createElement("p",null,"KOSMOS Mobile works to safeguard your personally identifiable information. KOSMOS Mobile limits access to personally identifiable information about our customers to employees who we believe reasonably need to use that information to provide products or services to our customers or in order to do their jobs."),u.default.createElement("p",null,"I. We have physical, electronic, and procedural safeguards that comply with federal regulations to protect personal information about our customers."),u.default.createElement("p",null,"II.  We use technologies to safeguard personal information including:"),u.default.createElement("p",null,"a. Secure Socket Layer (SSL) encryption"),u.default.createElement("p",null,"b. Firewalls and intrusion detection systems"),u.default.createE